import React from 'react';
import { Switch, Route } from 'react-router-dom';

import { Index, SocialIsolation } from '../pages';

const Routes: React.FC = () => (
  <Switch>
    <Route path="/" exact component={Index} />
  </Switch>
);

export default Routes;
